package com.class10;

public class ArraysHW {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		String[] cars= {"Range Rover", "Mercedes Benz", "BMW", "Lexus", "Infiniti", "Porsche"};
		
		for (String a:cars) {
			System.out.println(a);
		}
		
		
		for (int a=0; a<=5; a++) {
			System.out.println(cars[a]);
		}
	}

}
